                              #soloProList {
                                width: 60%;
                                min-width: 300px;
                              }
                            }
                          
                            #soloPro1 {
                              display: table-row;
                            }
                        `}</style>
                    </div>
            )} else {
                return setTimout(functionnull, 1000)
            };
    }
}

export default SoloContent;
